import './Categoria.css';
import Video from '../Video/Video';

const Categoria = (props) => {

    const {colorPrimario, titulocategoria} = props.datos
    const {videos} = props
    const estiloFondo = {
        backgroundColor: colorPrimario
    }
    return <section className="contenedorCategoria" >
            <h2 style={estiloFondo}>{titulocategoria}</h2>
            <div className="contenedorVideos">
                    {
                        videos.map((video, index)=><Video datos={video} key={index} estilo={estiloFondo}/>)
                    }
            </div>
        </section>

}

export default Categoria;
